  salinity and HYDROSTATIC PRESSURE collected from discrete sample and profile observations
  using Alkalinity titrator, CTD and other instruments from the KA'IMIKAI-O-KANALOA,
  KILO MOANA and ROGER REVELLE in the North Pacific Ocean and Papahanaumokuakea Marine
  National Monument from 2002-07-01 to 2003-08-21 (NODC Accession 0108077)\",\n\t\"tracking_summary\":
