  [],\n\t\"revision_timestamp\": \"2015-09-26T19:36:09.239720\",\n\t\"name\": \"dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-hydrostatic-pressure-collected-f\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108077 includes chemical,
  discrete sample, physical and profile data collected from KA'IMIKAI-O-KANALOA, KILO
  MOANA and ROGER REVELLE in the North Pacific Ocean and Papahanaumokuakea Marine
  National Monument from 2002-07-01 to 2003-08-21 and retrieved during cruise MP-5
  cruise, MP-6 cruise and MP-9 cruise. These data include ALKALINITY, DISSOLVED INORGANIC
  CARBON, HYDROSTATIC PRESSURE, SALINITY and WATER TEMPERATURE. The instruments used
  to collect these data include Alkalinity titrator, CTD, Coulometer for DIC measurement
  and bottle. These data were collected by Patricia L. Yager of University of Georgia;
  School of Marine Programs as part of the MP-5 cruise, MP-6 cruise and MP-9 cruise
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
